import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <FullName FirstName = 'Mykytiuk' LastName = 'Da'/>
    </div>
  );
}



function FullName(props) {
  let {FirstName:f, LastName:l}=props;
  return(
    <div>
      <h1>Full Name</h1>
      <p>My name is <strong>{f} {l}</strong></p>
    </div>

  );
}

export default App;
